import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';

function Home() {
  return (
    <div dangerouslySetInnerHTML={{ __html: require('./pages/Home.html').default }} />
  );
}

function About() {
  return (
    <div dangerouslySetInnerHTML={{ __html: require('./pages/About.html').default }} />
  );
}

function Services() {
  return (
    <div dangerouslySetInnerHTML={{ __html: require('./pages/Services.html').default }} />
  );
}

function Contact() {
  return (
    <div dangerouslySetInnerHTML={{ __html: require('./pages/Contact.html').default }} />
  );
}

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />
        <Route path="/services" component={Services} />
        <Route path="/contact" component={Contact} />
      </Switch>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
